  [],\n\t\"revision_timestamp\": \"2016-03-29T23:22:18.618699\",\n\t\"name\": \"daily-treasury-real-yield-curve-rates\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"These rates are commonly referred to as
  \"Real Constant Maturity Treasury\" rates, or R-CMTs. Real yields on Treasury Inflation
  Protected Securities (TIPS) at \"constant maturity\" are interpolated by the U.S.
  Treasury from Treasury's daily real yield curve. These real market yields are calculated
  from composites of secondary market quotations obtained by the Federal Reserve Bank
  of New York. The real yield values are read from the real yield curve at fixed maturities,
  currently 5, 7, 10, 20, and 30 years. This method provides a real yield for a 10
  year maturity, for example, even if no outstanding security has exactly 10 years
  remaining to maturity.  Dataset updated daily every weekday.\",\n\t\"license_title\":
